import { StyleSheet, View } from "react-native";
import screen1a from "./view/screen1a";
import {Text, Button } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Stack = createNativeStackNavigator();

function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, justifyContent: 'space-around', alignItems: 'center', width: '100%'}}>
      <Button
        title="Go to screenscreen1a"
        onPress={() => navigation.navigate('screenscreen1a')}
      />

    </View>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="Home"
          component={HomeScreen}
          options={{ title: 'Home' }}
        />
        <Stack.Screen
          name="screenscreen1a"
          component={screenscreen1a}
          options={{ title: 'screenscreen1a' }}
        />

      </Stack.Navigator>
    </NavigationContainer>
  );
}
